import React from 'react'
import dictCategories from 'Utils/Menu/Constants';

const Categories = (props) =>{

    return(
        <div className = "menu-categories-section">
            {props.dictCategories.map((category , index)=>{
                console.log(category , dictCategories[category]);
            })};
        </div>
    );
}

export default Categories;
